import React, { Component } from 'react';

export class Projects extends Component {
    render() {
        return (
            <div style={main}>
                <h2 style={headingText}>Technical Projects</h2>
            </div>

        )
    }

}

const main = {
    display: 'flex',
    height: '100vh',
    backgroundColor: "#d9d9d9"
};

const headingText = {
    marginLeft: '20px',
    fontSize: '2rem'
}

export default Projects;
